        <div className={styles.Track}>
            <div className={styles.TrackInfo}>
                <h3>{props.track.name}</h3>
                <p><span className={styles.Orange}>Artist:</span> {props.track.artist}</p>
                <p><span className={styles.Orange}>Album:</span> {props.track.album}</p>
            </div>
            {renderChange()}
        </div>
    );
};

export default Track;
